import React from 'react';
import '../styles/TrafficPageStyles.css';

const TrafficPage = () => {
  return (
    <div className="traffic-page-container">
      {/* 지도 영역 대신, 지도를 표시할 영역만 남겨둡니다. */}
      <div className="map-placeholder">
        <p className="map-placeholder-text">지도 표시 영역</p>
      </div>

      {/* 사이드바 */}
      <div className="sidebar">
        <h2>🚦 교통 혼잡도 안내</h2>
        <ul className="legend-list">
          <li><span className="color-box red-box"></span> 매우 혼잡</li>
          <li><span className="color-box yellow-box"></span> 보통</li>
          <li><span className="color-box green-box"></span> 원활</li>
        </ul>

        <h3>교통 혼잡도 상위 5곳</h3>
        <ul className="legend-list">
          <li><span className="color-box red-bo"></span> 1. 이문동</li>
          <li><span className="color-box yellow-bx"></span> 2. 회기동</li>
          <li><span className="color-box green-bx"></span> 3. 휘경동</li>
        </ul>
        <h3>예측 데이터</h3>
        <p className="prediction-text">다음 1시간 동안 주요 도로 혼잡 예상 구간: 청량리역, 장안동 사거리</p>

        <h3>실시간 알림</h3>
        <div className="alert-box">
          🚨 장안동 사거리 차량 사고로 인한 정체
        </div>
      </div>
    </div>
  );
};

export default TrafficPage;
